import { Button, Pressable, SafeAreaView, StatusBar, StyleSheet, Text, View } from 'react-native';

export function CreateNoteUI({navigation}) {

 const ui = (
  
  <SafeAreaView style={styles.main}>
      <StatusBar/>
      <View style={styles.view1}>
        <Text style={styles.text1}>Create New Note</Text>
      </View>

      <View style={styles.view2}>
        <Pressable />
      </View>

      <View style={styles.view3}>
        <Text>View 03</Text>
      </View>
      
    </SafeAreaView>
 );

  return ui;
}

const styles = StyleSheet.create({
  main: {
    flex: 1,
  },

  view1:{
    flex: 1,
    backgroundColor: "red",
  },
  
  view2:{
    flex: 1,
    backgroundColor: "yellow",
  },

  view3:{
    flex: 6,
    backgroundColor: "blue",
  },

  text1:{
    fontSize: 50,
    color: "white",
  },

  btn:{
    flex:2,
    backgroundColor:"red"
  }
});
